  "dmConversation" : {
    "conversationId" : "14790314-21135674",
    "messages" : [ {
      "messageCreate" : {
        "recipientId" : "21135674",
        "text" : "Let me know re: the 32% question. Not sure what you were doing there. matt.stiles@latimes.com",
        "mediaUrls" : [ ],
        "senderId" : "14790314",
        "id" : "1054545747322884101",
        "createdAt" : "2018-10-23T01:31:13.371Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "One thing I was thinking about was looking to see if there were \"repeat offenders\" (if you can call them that) that had consecutive years of high overtime wages.",
        "mediaUrls" : [ ],
        "senderId" : "21135674",
        "id" : "1054492018921984005",
        "createdAt" : "2018-10-22T21:57:43.531Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "3M is a lot!",
        "mediaUrls" : [ ],
        "senderId" : "21135674",
        "id" : "1054491808737062916",
        "createdAt" : "2018-10-22T21:56:53.403Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "21135674",
        "text" : "Do I care about average overtime per employee, or overtime spending growth in departments overall, or just the maxes from each place? Not sure. It's a big data set. The 3 million records are choking my little SQLite instance. Might switch over to Postgres.",
        "mediaUrls" : [ ],
        "senderId" : "14790314",
        "id" : "1054491491471507460",
        "createdAt" : "2018-10-22T21:55:37.767Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "The data I looked at is from the LA County system: https://t.co/aCSlK1IJOA",
        "mediaUrls" : [ ],
        "senderId" : "21135674",
        "id" : "1054491213145882628",
        "createdAt" : "2018-10-22T21:54:31.423Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "21135674",
        "text" : "Tricky because the state data is anonymized but has \"fire department\" as an agency. The other data has names but no department, so you have to LIKE query for \"fire\" and \"battalion\" and \"chief\" in the title field. Not sure which approach is best.",
        "mediaUrls" : [ ],
        "senderId" : "14790314",
        "id" : "1054491123161288708",
        "createdAt" : "2018-10-22T21:54:09.953Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "I had the same thought - compare the largest counties in CA to the LA findings. Would be interesting!",
        "mediaUrls" : [ ],
        "senderId" : "21135674",
        "id" : "1054491111119499268",
        "createdAt" : "2018-10-22T21:54:07.099Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "21135674",
        "text" : "I'm working on a follow up now using data from here Transparent California (https://t.co/Sbuu3U989P) and the state (https://t.co/NS1yONLtz5). I'd like to run the same queries on fire departments in 20 or so large counties and cities and the state.",
        "mediaUrls" : [ ],
        "senderId" : "14790314",
        "id" : "1054490799159697413",
        "createdAt" : "2018-10-22T21:52:52.726Z"
      }
    } ]
  }
