        "text" : "fwiw, \"In addition to financial assistance, we know that making sure you have coverage for your children is important, so we also offer attendees free childcare run by providers we trust with our own kids. We’ll have more details about that soon, and there’s also a question on the form to let us know you’d like all the info about childcare.\"",
