        "text" : "Official registration for NICAR 2018 in Chicago was 1252.  \n\nRight now, we don't track international or any other demographics.  We haven't made it a required field in the past so any reports we can pull together will not have accurate data.  \n\nWe are in the middle of a redesign to our system, and this data will be collected and hopefully easier to obtain for future conferences.",
