        "text" : "Excellent.  Btw - not surprisingly I've detected that both city and county are doing more video presentations to enhance the excessive backslapping, and endless supply of thank yous. Wld be interesting to see if the number of thank yous rises as the number of presentation rises ... you'll like this: https://t.co/GJ7ce8t6EY",
