        "text" : "Hi Matt! I’ll be giving a talk on North Korea and the transnational women’s mobilization for peace. Joining me is Joy Yoon who lives in Dallas but before the travel ban lived in NK for 10 years with her husband a doctor providing humanitarian aid. We’re speaking together on Saturday in Culver City. Should be an interesting and well attended event — any chance you can cover for LA times even tho you no longer cover Korea? She’s a republican evangelical missionary and I’m a democrat progressive atheist. And we’re on the exact same page... I gave Stephen Biegun her book when i met him a few weeks ago...",
        "mediaUrls" : [ ],
