        "text" : "Hi Matt,\n\nMy name is Ted Henson. I am a statistics and analytics major at UNC Chapel Hill very interested in analytics. \n\nI have an assignment for a Data Journalism class in which I have to interview the author of a data driven story about the overall process of creating it.\n\nIf you have 5 or 10 minutes to chat about this in the next week, please let me know.\n\nThank you,\nTed Henson",
