        "recipientId" : "3353865792",
        "text" : "Hello, old friend. How are you? Korea in January will be cold! Is she going to Seoul? She will be safe going to the DMZ. Tell her to take a USO tour, which will be filled with Westerners. They leave from Yongsan Garrison. I have two favorites for Korean BBQ. Busan Galbi in Itaewon and Chadol House in Noksapyeong. (All three of these places are accessible from the 6 line in central Seoul). Have her email me if she needs help. mattstiles@gmail.com. Happy turkey day!",
