        "recipientId" : "14790314",
        "text" : "Hi there Sorry, I hope this message finds you well. I'm writing for suggestions on South Korea. A friend is traveling there in January - a female traveling alone. Is she safe to visit the DMZ? Are there must sees you recommend? Restaurant suggestions? She's also a big K-POP fan. There's no rush, and please don't let it interrupt your holidays. I'm just concerned about her safety and if you have any quick ideas beyond that, if you're able, great. No pressure. Thanks",
