  "dmConversation" : {
    "conversationId" : "14790314-917726718043017216",
    "messages" : [ {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "Hello Stiles\n\nHow are you today? My name is Mr Amankwaa Kelechi Edmond, I am regional manager here in ACCRA, GHANA. I am writing this letter to you because of your surname. I have been in \nsearch of someone with your last name, so when I saw your name I was propelled to contact you for this opportunity and hope we can work together.\n\nLate Peter Stiles, is a citizen of your Country, who had a fixed deposit with my bank here in GHANA in 2009 for 72 calendar months, valued at £4,400,000.00 (Four \nmillion and Four Hundred Thousand pounds) the due date for this deposit contract was last November 2013. Sadly \"Peter was among the death victims in the march 11th \n2011 Earthquake disaster in Japan, He was in Japan on a business trip when the Earthquake happened.\n\nMy bank management is yet to know about his death, I knew about it because he was my friend and I am his account officer. Peter , did not mention any beneficiary when \nthe account was opened, and i have tried without success to find any member of his family. Last week my Bank Management requested that i should give instructions on \nwhat to do about the funds, if to renew the contract.\n\nI know this will happen and that is why I have been looking for a means to handle the situation, because if my Bank Directors happens to know that \"Peter is dead and \ndo not have any beneficiary to the funds, they will take the funds for their personal use, so I don't want such to happen. That was why when I saw your last name I was \nhappy and I am now seeking your co-operation to present you as beneficiary to the account, since you have the same last name with him and our bank head quarters will \napprove the transfer of the funds in your name because your surname is the only thing that qualifies you to stand as the beneficiary of Peter.\n\nThere is no risk involved because i am equally part of this process therefore you can be assured that this process will a success for us. I don't want the bank to confiscate the money.\n\nPlease write to my private email for further details: amankwaaedmond12@gmail.com\n\nWaiting to hear from you.\n\nWith Regards,\n\nAmankwaa Kelechi Edmond",
        "mediaUrls" : [ ],
        "senderId" : "917726718043017216",
        "id" : "1097891503291142149",
        "createdAt" : "2019-02-19T16:11:46.951Z"
      }
    } ]
  }
