  "dmConversation" : {
    "conversationId" : "14190948-14790314",
    "messages" : [ {
      "messageCreate" : {
        "recipientId" : "14190948",
        "text" : "Yeah, it's frustrating that Wilson's account, because it was released, is being taken as Gospel. (Didn't mean to take so much of your time).",
        "mediaUrls" : [ ],
        "senderId" : "14790314",
        "id" : "537626549684797441",
        "createdAt" : "2014-11-26T15:18:52.737Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "Your size translates to being fearless in the face of bullets.",
        "mediaUrls" : [ ],
        "senderId" : "14190948",
        "id" : "537626164794494976",
        "createdAt" : "2014-11-26T15:17:20.969Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14190948",
        "text" : "Not that Wilson is small, of course! Anyway, this story is so frustratingly sad. Thanks for responding.",
        "mediaUrls" : [ ],
        "senderId" : "14790314",
        "id" : "537626115708555264",
        "createdAt" : "2014-11-26T15:17:09.268Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "I'm not sure it makes sense to pass judgment on someone based off of a single event. I also don't think being willing to intimidate with",
        "mediaUrls" : [ ],
        "senderId" : "14190948",
        "id" : "537626003355742208",
        "createdAt" : "2014-11-26T15:16:42.485Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "What the clerk thought in this case wasn't relevant",
        "mediaUrls" : [ ],
        "senderId" : "14190948",
        "id" : "537625569631170561",
        "createdAt" : "2014-11-26T15:14:59.072Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14190948",
        "text" : "I'm definitely not defending Wilson's action. But Brown in the video seemed like someone who didn't mind intimidating people with his size.",
        "mediaUrls" : [ ],
        "senderId" : "14790314",
        "id" : "537625522759827456",
        "createdAt" : "2014-11-26T15:14:47.898Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14790314",
        "text" : "Because the point of the piece was to contrast two descriptions and also note the similarities Wilson's has to long standing racist tropes",
        "mediaUrls" : [ ],
        "senderId" : "14190948",
        "id" : "537625448663244802",
        "createdAt" : "2014-11-26T15:14:30.229Z"
      }
    }, {
      "messageCreate" : {
        "recipientId" : "14190948",
        "text" : "Enjoyed your piece on Brown. I do wonder, tho, why his behavior in the store wasn't mentioned. He seemed pretty scary to that clerk, too.",
        "mediaUrls" : [ ],
        "senderId" : "14790314",
        "id" : "537625171348422656",
        "createdAt" : "2014-11-26T15:13:24.114Z"
      }
    } ]
  }
